import React from "react";
import LayoutHeader from "./Header";
import LayoutFooter from "./Footer";
import "./Home.scss";
import { Layout } from "antd";

const { Content } = Layout;

const Body = () => (
  <Content>
    <p className="text1">
      SAVE IN BITS <br />
      EVERYTIME YOU SPEND.
      <br /> EARN DOLLARS DAILY.
    </p>
  </Content>
);

function Home() {
  return (
    <Layout>
      <LayoutHeader />
      <Body />
      <LayoutFooter />
    </Layout>
  );
}

export default Home;
